Vue.use(Vuex);const store=new Vuex.Store({state:{presentacion:!1,imagenes:!1,titulo:""},mutations:{toggleModal(e,t){e[t.element]=t.display,e.titulo=t.title}}});import modal from"./components/modal.min.js";import presentacion from"./components/presentacion.min.js";import imagenes from"./components/imagenes.min.js";var app=new Vue({store:store,components:{modal:modal,presentacion:presentacion,imagenes:imagenes},delimiters:["${","}"],el:"#main",data:{},computed:{presentacion:()=>store.state.presentacion,imagenes:()=>store.state.imagenes},methods:{editarPresentacion(){store.commit("toggleModal",{display:!0,element:"presentacion",title:"Editar Presentacion"})},editarImagenes(){store.commit("toggleModal",{display:!0,element:"imagenes",title:"Editar Imagenes"})}}});